// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract AdmissionsOffice {
    address[] private students;
    mapping(address => bool) private approvedAdmissionsOfficers;
    uint256 private maxStudents;

    constructor(uint256 _maxStudents) {
        maxStudents = _maxStudents;
    }

    receive() external payable {
        // No logic required in the fallback function
    }

    modifier onlyAdmissionsOfficer() {
        require(approvedAdmissionsOfficers[msg.sender], "Only approved admissions officers can call this function");
        _;
    }

    function getStudents() external view returns (uint256, address[] memory) {
        address[] memory studentAddresses = new address[](students.length);
        for (uint256 i = 0; i < students.length; i++) {
            studentAddresses[i] = students[i];
        }
        return (students.length, studentAddresses);
}




    function addStudent(address student) public {
        students.push(student);
    }

    function approveAdmissionsOfficer(address officer) external onlyAdmissionsOfficer {
        approvedAdmissionsOfficers[officer] = true;
    }
}

